import axios from 'axios';
import React, { useEffect, useState } from 'react';
import { Link, useHistory } from 'react-router-dom';

const ClaimList = () => {
  const [claims, setClaims] = useState([]);
  const [selectedClaim, setSelectedClaim] = useState(null);
  const [remarks, setRemarks] = useState('');
  const history = useHistory();

  useEffect(() => {
    axios.get('http://localhost:8080/admin/claims', {
      headers: {
        'Authorization': 'Basic YWRtaW4xMjM6Y21z'
      }
    })
    .then(response => {
      setClaims(response.data);
    })
    .catch(error => {
      console.error('There was an error fetching the claims!', error);
    });
  }, []);

  const handleClaimClick = (claim) => {
    setSelectedClaim(claim);
  };

  const handleApproval = (id, isApproved, remarks) => {
    axios.post(`http://localhost:8080/admin/claims/${id}/approve?remarks=${remarks}&isApproved=${isApproved}`, {}, {
      headers: {
        'Authorization': 'Basic YWRtaW4xMjM6Y21z'
      }
    })
    .then(response => {
      // After successful approval/rejection, redirect to the claims list
      setSelectedClaim(null);
      history.push('/claimlist'); // Assuming '/' is the route for the claims list
    })
    .catch(error => {
      console.error('There was an error updating the claim status!', error);
    });
  };

  return (
    <div>
      <h1>Claims List</h1>
      {!selectedClaim ? (
        <table>
          <thead>
            <tr>
              <th>ID</th>
              <th>Email</th>
              <th>Amount Claimed</th>
              <th>Policy Name</th>
              <th>Status</th>
              <th>Action</th>
            </tr>
          </thead>
          <tbody>
            {claims.map(claim => (
              <tr key={claim.id} onClick={() => handleClaimClick(claim)}>
                <td>{claim.id}</td>
                <td>{claim.userEmail}</td>
                <td>{claim.amountClaimed}</td>
                <td>{claim.policyName}</td>
                <td>{selectedClaim.status}</td>
                <td>
                  <Link to="/claimlist">View</Link>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      ) : (
        <div>
          <h2>Claim Details</h2>
          <p><strong>ID:</strong> {selectedClaim.id}</p>
          <p><strong>Email:</strong> {selectedClaim.userEmail}</p>
          <p><strong>Amount Claimed:</strong> {selectedClaim.amountClaimed}</p>
          <p><strong>Policy Name:</strong> {selectedClaim.policyName}</p>
          <p><strong>Status:</strong> {selectedClaim.status}</p>
          <div>
            <label>
              Remarks:
              <input
                type="text"
                value={remarks}
                onChange={(e) => setRemarks(e.target.value)}
              />
            </label>
            <div>
              <button onClick={() => handleApproval(selectedClaim.id, true, remarks)}>Approve</button>
              <button onClick={() => handleApproval(selectedClaim.id, false, remarks)}>Reject</button>
            </div>
          </div>
        </div>
      )}
    </div>
  );
};

export default ClaimList;
